import { useSelector} from 'react-redux'


const Maestro = () => {
    const usuario = useSelector((state) => state.usuario[0].name)
    console.log(usuario)
    if(usuario){
        return (
            <h1>Bienvenido Maestro {usuario}</h1>
        )
    } else {
        return (
            <h1>Bienvenido Maestro invitado</h1>
          )
    }


}

export default Maestro
